window.bookSummaryJSON = "<p>Ever since moving into the \"haunted house\" in Devland, Georgia, Corbin has been having strange dreams. Every time he falls asleep, he finds himself drawn into a world of nightmares called the Winterland. Each night, his curiosity lures him a little farther from the safety of his own reality, but he is about to discover that sometimes, when you walk into a nightmare, it can be hard to walk out again.</p>"; 
